import React, { useState , useEffect } from 'react'
import './App.css'

function App() {
  const [open , setOpen] = useState('open')

  function handleClick(){
    if(open==='open'){
      setOpen('close')
    }
    setOpen('open')
  }

  return (
    <div>
      <img src={`./images/${open}.png`} alt='folder' onClick={handleClick}/>
    </div>
  );
}

export default App;
